import React from 'react'; // Ensure React is imported
import styles from './Sidebar.module.css';

const Sidebar = () => {
    return (
            <aside id="sidebar">
                <button>Main</button>
                <button>Settings</button>
                <button>About</button>
            </aside>
    );
};

export default Sidebar;
